		taka = scan.nextInt();
		total += taka;

		taka = scan.nextInt();
		total += taka;

		taka = scan.nextInt();
		total += taka;

		taka = scan.nextInt();
		total += taka;

		taka = scan.nextInt();
		total += taka;

		taka = scan.nextInt();
		total += taka;

		taka = scan.nextInt();
		total += taka;

		taka = scan.nextInt();
		total += taka;

		taka = scan.nextInt();
		total += taka;

		taka = scan.nextInt();
		total += taka;

		System.out.printf("%d\n", total);

