		t3 = scan.nextInt();
		t4 = scan.nextInt();
		t5 = scan.nextInt();
		t6 = scan.nextInt();
		t7 = scan.nextInt();
		t8 = scan.nextInt();
		t9 = scan.nextInt();
		t10 = scan.nextInt();

